// SPDX-License-Identifier: MIT
pragma solidity ^0.6.0;


import { TxScriptLib } from "./TxScriptLib.sol";
import { BadgerHarvestAllScriptLib } from "./BadgerHarvestAllScriptLib.sol";

contract BadgerHarvestAllScript {
  using BadgerHarvestAllScriptLib for *;
  constructor(address[] memory strategies) public {
    strategies.harvestAll();
    TxScriptLib.terminate();
  }
}

contracts/TxScriptLib.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.6.0;

library TxScriptLib {
  function terminate() internal pure {
    assembly {
      return(0x0, 0x0)
    }
  }
}

contracts/BadgerHarvestAllScriptLib.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.6.0;

import { IStrategy } from "./IStrategy.sol";

library BadgerHarvestAllScriptLib {
  function harvestAll(address[] memory strategies) internal {
    for (uint256 i = 0; i < strategies.length; i++) {
      IStrategy(strategies[i]).harvest();
    }
  }
}

